(2, 'jk', '1510962735.jpg', 'REASONING ABILITY', 'Subject', '<h1><strong>WHAT IS REASONING</strong></h1>\r\n\r\n<p><strong>Reasoning</strong>&nbsp;is a process of grabbing information from the given situations then analyzing it and coming up with appropriate solutions.</p>\r\n\r\n<p>Reasoning is a part of our daily life and it is applied almost everywhere whether knowingly or unknowingly. We use many of the reasoning skills in daily life without a notice like to distinguish between positive and negative situations, to decide how to approach a problem and resolve it.</p>\r\n\r\n<p>Reasoning ability is not built up in a single day but it&rsquo;s a lifetime process, so we at&nbsp;<strong>Sterling Education</strong>&nbsp;bring up to your notice about all the concepts and help you prepare for competitive exams as Reasoning is a part of competitive exams like&nbsp;<strong>Bank,&nbsp;<a href=\"https://ssc.nic.in/\">SSC</a>, Railways, CAT, MAT</strong>&nbsp;and many more.</p>\r\n\r\n<p>Reasoning is bifurcated into many types like&nbsp;<strong>Analytical Reasoning, Logical Reasoning and Non-Verbal Reasoning.</strong></p>\r\n\r\n<p>Each of its types build a different type of skill in a candidate and helps in development of a student.</p>\r\n\r\n<h3>TOPICS COVERED UNDER&nbsp;<strong>ANALYTICAL REASONING</strong>&nbsp;ARE:</h3>\r\n\r\n<ul>\r\n	<li>Syllogism</li>\r\n	<li>Blood Relations</li>\r\n	<li>Sitting Arrangement</li>\r\n	<li>Puzzles</li>\r\n	<li>Figure Counting</li>\r\n	<li>Coding-Decoding</li>\r\n	<li>Calendars</li>\r\n	<li>Clocks</li>\r\n	<li>Cubes &amp; Dice</li>\r\n	<li>Analogy</li>\r\n	<li>Data Sufficiency</li>\r\n	<li>Figure Matrix</li>\r\n	<li>Direction Test</li>\r\n	<li>Missing Number in Series</li>\r\n	<li>Course of Action</li>\r\n	<li>Statements &amp; Assumptions</li>\r\n	<li>Statements &amp; Conclusions</li>\r\n	<li>Strength of Arguments</li>\r\n	<li>Cause &amp; Effect</li>\r\n	<li>Non Verbal Reasoning</li>\r\n</ul>\r\n\r\n<p>We at&nbsp;<a href=\"https://www.st