(4, 'mklm', '1813139126.jpg', 'IBPS RRB', 'Competitive', '<p>The&nbsp;<a href=\"https://ibps.in/\"><strong>Institute of Banking Personnel Selection</strong></a>&nbsp;conducts the IBPS RRB Exam to recruit officers who will head the various Regional Rural Banks (RRB) in India. The recruitment is done at two levels. They are as follows:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Group A Officers:</strong>&nbsp;Scale-I (Assistant Manager), Scale-II (Manager), Scale-III (Senior Manager)</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Group B Office Assistants:</strong>&nbsp;Multipurpose Office Assistants</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><a href=\"https://www.sterlingeducation.co.in/\"><strong>Sterling Education</strong></a>&nbsp;is one of the best coaching institute in Jaipur for IBPS SO preparation. Being a reputed institute we provide you with&nbsp;<strong>quality study material, gives you personal attention as our batch strength is minimal</strong>, gives you a familiar and comfortable environment like&nbsp;<strong>Air Conditioned classrooms</strong>,&nbsp;<strong>Experienced faculties</strong>,&nbsp;<strong>Doubt solving sessions</strong>&nbsp;and many more.</p>\r\n\r\n<p>In the world of Online studies we provide you with the facility of&nbsp;<strong>Online mock tests along with our online video courses</strong>&nbsp;so that you can easily deal with the exam pressure.</p>', '<p><strong>QUANTITATIVE APTITUDE</strong></p>\r\n\r\n<p>Percentage, Profit &amp; Loss, Averages, Time &amp; Work, Pipes &amp; Cisterns, Ratio &amp; Proportion, Partnership, Time &amp; Distance, Boats &amp; Streams, Mixtures &amp; Alligations, Problems on Ages, Simple Interest, Compound Interest, Mensuration, Permutation &amp; Combinations, Probability, Data Sufficiency, Data Interpretation, Data Analysis, Simplification, Approximations, Number Series, Quadratic Equations, Caselets.</p>\r\n\r\n<p><strong>REASONING</strong></p>\r\n\r\n<p>Alphanumeric Series, Coding-Decoding, Equality-Inequality, Ranking, Direction Test, Blood Relations, Syllogism, Sitting Arrangement, Puzzles, Input-Output, Data Sufficiency, Decision Making, Cause &amp; Effect, Course of Action, Statements &amp; Assumptions, Statements &amp; Conclusions, Statements &amp; Arguments, Inference from Passage.</p>\r\n\r\n<p><strong>ENGLISH LANGUAGE</strong></p>\r\n\r\n<p>Reading Comprehension, Cloze Test, Para jumbles, Fill in the blanks, Error Spotting, Miscellaneous, Paragraph Completion, Verbal Ability.</p>\r\n\r\n<p><strong>HINDI LANGUAGE</strong></p>\r\n\r\n<p>Vyakaran, Fill in the Blanks, Mistakes, Paragraphs.</p>\r\n\r\n<p><strong>COMPUTER KNOWLEDGE</strong></p>\r\n\r\n<p>Computer Fundamentals, Computer Abbreviations, Software and Hardware Fundamentals, Shortcut Keys, Networking, Basic Knowledge of Internet, MS Office, History of Computers, Database, Security Tools, History and Future of Computers, Virus, Hacking.</p>\r\n\r\n<p><strong>GENERAL AWARENESS</strong></p>\r\n\r\n<p>Current Affairs, Economics, Awards and Honors, Books and Authors, Sports, Finance, Agriculture, Repo and Reverse Repo Rate, History of Banking, Indian and International Economy, Countries/Currencies.</p>', '<p>IBPS RRB ASSISTANT EXAM PATTERN</p>\r\n\r\n<p>The exam pattern for the selection to the post of Office Assistant is quite different to that of exam pattern for the selection to the post of Officer Grade. For IBPS RRB Assistant Exam will be conducted in two phases:</p>\r\n\r\n<ul>\r\n	<li><strong>Preliminary Exam</strong></li>\r\n	<li><strong>Mains Exam</strong></li>\r\n</ul>\r\n\r\n<p>No interview process will be conducted for selecting candidates to the post of Office Assistant. Selection will be made purely on the marks obtained by candidate in his/her Mains Examination.</p>\r\n\r\n<p><strong>IBPS ASSISTANT PRELIMINARY EXAM PATTERN</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Section</td>\r\n			<td>No. of questions</td>\r\n			<td>Marks</td>\r\n			<td>Duration</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n			<td rowspan=\"2\">A cumulative time of 45 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Numerical Ability</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>80</td>\r\n			<td>80</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>IBPS ASSISTANT MAINS EXAM EXAM PATTERN</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Section</td>\r\n			<td>No. of questions</td>\r\n			<td>Marks</td>\r\n			<td>Duration</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning</td>\r\n			<td>40</td>\r\n			<td>50</td>\r\n			<td rowspan=\"5\">A cumulative time of 2 hours is provided</td>\r\n		</tr>\r\n		<tr>\r\n			<td>General Awareness</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Numerical Ability</td>\r\n			<td>40</td>\r\n			<td>50</td>\r\n		</tr>\r\n		<tr>\r\n			<td>English/Hindi</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Computer Language</td>\r\n			<td>40</td>\r\n			<td>20</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>200</td>\r\n			<td>200</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>No interview is required after the Mains Exam to get selected for the post of Office Assistant.</strong></p>\r\n\r\n<p>IBPS RRB OFFICER EXAM PATTERN</p>\r\n\r\n<p>For&nbsp;<strong>IBPS RRB Officer&nbsp;</strong>exam will be conducted in three phases:</p>\r\n\r\n<ul>\r\n	<li><strong>Preliminary Exam</strong></li>\r\n	<li><strong>Mains Exam</strong></li>\r\n	<li><strong>Interview Process</strong></li>\r\n</ul>\r\n\r\n<p>The final selection will be made on the cumulative score obtained by candidate in&nbsp;<strong>both Mains Exam and Interview Process</strong></p>\r\n\r\n<p><strong>IBPS RRB OFFICER GRADE PRELIMINARY EXAMINATION</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Section</td>\r\n			<td>No. of questions</td>\r\n			<td>Marks</td>\r\n			<td>Duration</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n			<td rowspan=\"2\">A cumulative time of 45 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Numerical Ability</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>80</td>\r\n			<td>80</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>IBPS RRB MAINS EXAM (OFFICER SCALE-I)</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Section</td>\r\n			<td>No. of questions</td>\r\n			<td>Marks</td>\r\n			<td>Duration</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning</td>\r\n			<td>40</td>\r\n			<td>50</td>\r\n			<td rowspan=\"5\">A cumulative time of 2 hours is provided</td>\r\n		</tr>\r\n		<tr>\r\n			<td>General Awareness</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Numerical Ability</td>\r\n			<td>40</td>\r\n			<td>50</td>\r\n		</tr>\r\n		<tr>\r\n			<td>English/Hindi</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Computer Language</td>\r\n			<td>40</td>\r\n			<td>20</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>200</td>\r\n			<td>200</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>A common exam (single exam) will be conducted for IBPS RRB Officer Scale-II &amp; III this year to select candidates on the basis of their professional knowledge.</p>\r\n\r\n<p>PAY SCALE OF IBPS RRB OFFICER SCALE I</p>\r\n\r\n<p>The pay scale for IBPS RRB Officer Scale-I is&nbsp;<strong>Rs. 23700-980/7-30560-1145/2-32850-1310/7-42020.</strong></p>\r\n\r\n<p>For new recruits under Officer scale I, the in-hand salary varies from&nbsp;<strong>Rs. 45,000/- to Rs. 50,000/- at 100 % DA</strong>.</p>\r\n\r\n<p>PAY SCALE OF IBPS RRB OFFICE ASSISTANT</p>\r\n\r\n<p>IBPS RRB Office Assistant Pay Scale is&nbsp;<strong>Rs. 7200-(400/3)-8400-(500/3)-9900-(600/4)-12300-(700/7)-17200-(1300/1)-18500-(800/1)-19300</strong></p>\r\n\r\n<p>The in-hand salary of IBPS RRB Office Assistant varies from&nbsp;<strong>Rs. 15,000 &ndash; 20,000/-</strong>. This salary may vary for different organizations.</p>', '<p><strong>EDUCATIONAL QUALIFICATION</strong></p>\r\n\r\n<p>The educational qualification is different for various posts like Office Assistant, Officer Scale I, Scale II and Scale III.</p>\r\n\r\n<p><strong>Office Assistant:&nbsp;</strong>Bachelor&rsquo;s degree in any discipline from a recognized University or its equivalent.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Proficiency in local language as prescribed by the participating RRB/s*</p>\r\n	</li>\r\n	<li>\r\n	<p>Desirable: Working knowledge of Computer.</p>\r\n	</li>\r\n	<li>\r\n	<p>No experience required</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Office Scale I (Assistant Manager):&nbsp;</strong>Bachelor&rsquo;s degree in any discipline from a recognized University or its equivalent Preference will be given to the candidates having degree in Agriculture, Horticulture, Forestry, Animal Husbandry, Veterinary Science, Agricultural Engineering, Pisciculture, Agricultural Marketing and Cooperation, Information Technology, Management, Law, Economics or Accountancy.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Proficiency in local language as prescribed by the participating RRB/s*</p>\r\n	</li>\r\n	<li>\r\n	<p>Desirable: Working knowledge of Computer.</p>\r\n	</li>\r\n	<li>\r\n	<p>No experience required</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Office Scale II General Banking Officer (Manager):&nbsp;</strong>Bachelor&rsquo;s degree in any discipline from a recognized University or its equivalent with a minimum of 50 % marks in aggregate. Preference will be given to the candidates having degree in Banking, Finance, Marketing, Agriculture, Horticulture, Forestry, Animal Husbandry, Veterinary Science, Agricultural Engineering, Pisciculture, Agricultural Marketing and Cooperation, Information Technology, Management, Law, Economics and Accountancy.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Minimum experience of 2 years as an officer in a Bank or Financial Institution.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Office Scale III (Senior Manager):&nbsp;</strong>Bachelor&rsquo;s degree in any discipline from a recognized University or its equivalent with a minimum of 50% marks in aggregate. Preference will be given to the candidates having Degree/ Diploma in Banking, Finance, Marketing, Agriculture, Horticulture, Forestry, Animal Husbandry, Veterinary Science, Agricultural Engineering, Pisciculture, Agricultural Marketing and Co-operation, Information Technology, Management, Law, Economics and Accountancy.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Minimum 5 years experience as an Officer in a Bank or Financial Institutions</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>AGE LIMIT</strong></p>\r\n\r\n<p><strong>For Office Assistant (Multipurpose):</strong>&nbsp;Between 18 years and 28 years.</p>\r\n\r\n<p><strong>For Officer Scale- I (Assistant Manager):</strong>&nbsp;Above 18 years and Below 30 years.</p>\r\n\r\n<p><strong>For Officer Scale- II (Manager):</strong>&nbsp;Above 21 years &ndash; Below 32 years.</p>\r\n\r\n<p><strong>For Officer Scale- III (Senior Manager):</strong>&nbsp;Above 21 years &ndash; Below 40 years.</p>\r\n\r\n<p><strong>LANGUAGE PROFICIENCY</strong></p>\r\n\r\n<p>Candidates applying for the posts of Office Assistant in any particular RRB is required to possess proficiency in the local language of the State/ UT in which the RRB is situated to be eligible for interview.</p>\r\n\r\n<p><strong>NATIONALITY / CITIZENSHIP OF APPLICANTS</strong></p>\r\n\r\n<p>A candidate applying for IBPS CWE PO Examination must be one of the following:</p>\r\n\r\n<ol>\r\n	<li>Citizen of India.</li>\r\n	<li>Subject of Nepal or Bhutan.</li>\r\n	<li>\r\n	<p>Tibetan Refugee who came to India before 1st January 1962 with the intention of permanent settlement.</p>\r\n	</li>\r\n	<li>\r\n	<p>Person of Indian Origin (PIO) who has migrated from Burma, Pakistan, Sri Lanka, Vietnam or East African countries of Zaire, Kenya, Tanzania, Uganda, Zambia, Ethiopia, Malawi, with the intention of permanent settlement in India.</p>\r\n	</li>\r\n	<li>\r\n	<p>Candidates belonging to the category 2, 3, 4 must have a certificate of eligibility issued by the Govt of India in their favour.</p>\r\n	</li>\r\n</ol>', '353', 'IBPS RRB Exam: Eligibility, Exam Pattern, Pay Scale, Syllabus', 'This article describes about the various details about IBPS RRB like eligibility criteria, exam pattern, syllabus, pay scale and other important details.', 'This article describes about the various details about IBPS RRB like eligibility criteria, exam pattern, syllabus, pay scale and other important details.', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-16 13:54:09', '2022-12-21 15:00:43', '2022-12-21 15:00:43'),
