a, syllabus, exam pattern, pay scale etc.', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-16 13:54:10', '2022-12-21 15:00:29', '2022-12-21 15:00:29'),
(6, 'bhjjh', '1163548833.jpg', 'IBPS PO', 'Competitive', '<p>IBPS PO&nbsp;<a href=\"https://www.sterlingeducation.co.in/bank-po-exam-coaching/\">Bank Exam</a>&nbsp;is conducted by The<a href=\"https://ibps.in/\"><strong>&nbsp;Institute of Banking P</strong><strong>ersonnel Selection</strong></a>&nbsp;for the recruitment of candidates as Probationary Officers in various banks. IBPS PO consists of three levels and that are&nbsp;<strong>Prelims, Mains</strong>&nbsp;and&nbsp;<strong>Interview</strong>. To move further in the process one must crack and clear the Preliminary exam in order to give Mains Examination and then the last step would be the interview.</p>\r\n\r\n<p>The&nbsp;<strong><a href=\"https://ibps.in/\">IBPS</a>&nbsp;CWE</strong>&nbsp;was earlier known as IBPS PO is conducting its 10th edition examination this year.</p>\r\n\r\n<p>IBPS provides its services to all&nbsp;<strong>Public-Sector Banks, SBI, RBI, NABARD, SIDBI, LIC</strong>&nbsp;&amp;&nbsp;<strong>Insurance companies</strong>&nbsp;and other Banks which are regular members of the IBPS society.</p>\r\n\r\n<p>Candidates between the age of 20-30 years of age as on 1st August of the recruitment years and are minimum of graduate are only eligible to apply for IBPS PO Exam.</p>\r\n\r\n<p>IBPS PO exam is a&nbsp;<strong>golden opportunity</strong>&nbsp;for all those aspiring candidates who want to pursue their career in Banking sector. Selection in this exam will get them with their dream job.</p>\r\n\r\n<p>Now let&rsquo;s discuss about the eligibility criteria, syllabus, exam pattern, pay scale and other important points regarding this exam:</p>', '<p>QUANTITATIVE APTITUDE</p>\r\n\r\n<p>Percentage, Profit &amp; Loss, Averages, Time &amp; Work, Pipes &amp; Cisterns, Ratio &amp; Proportion, Partnership, Time &amp; Distance, Boats &amp; Streams, Mixtures &amp; Alligations, Problems on Ages, Simple Interest, Compound Interest, Mensuration, Permutation &amp; Combinations, Probability, Data Sufficiency, Data Interpretation, Data Analysis, Simplification, Approximations, Number Series, Quadratic Equations, Caselets.</p>\r\n\r\n<p>REASONING</p>\r\n\r\n<p>Alphanumeric Series, Coding-Decoding, Equality-Inequality, Ranking, Direction Test, Blood Relations, Syllogism, Sitting Arrangement, Puzzles, Input-Output, Data Sufficiency, Decision Making, Cause &amp; Effect, Course of Action, Statements &amp; Assumptions, Statements &amp; Conclusions, Statements &amp; Arguments, Inference from Passage.</p>\r\n\r\n<p>ENGLISH LANGUAGE</p>\r\n\r\n<p>Reading Comprehension, Cloze Test, Para jumbles, Fill in the blanks, Error Spotting, Miscellaneous, Paragraph Completion, Verbal Ability.</p>\r\n\r\n<p>GENERAL AWARENESS</p>\r\n\r\n<p>Current Affairs, Financial Awareness with special reference to Banking Industry, Economics.</p>', '<p>The&nbsp;<strong>IBPS PO preliminary examination will be</strong>&nbsp;conducted online and candidates are allocated total duration of&nbsp;<strong>1 hour</strong>&nbsp;to complete the preliminary exam. It consists of&nbsp;<strong>3 sections with a total of 100 questions</strong>&nbsp;and maximum score of&nbsp;<strong>100 marks</strong>. There is negative marking and&nbsp;<strong>0.25 marks are deducted for each wrong answer</strong>&nbsp;attempted by a candidate.</p>\r\n\r\n<p><strong>IBPS PO PRELIMS EXAM PATTERN</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Subject Name</strong></td>\r\n			<td><strong>No. of Questions</strong></td>\r\n			<td><strong>Max. Marks</strong></td>\r\n			<td><strong>Time of each section</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>English Language</td>\r\n			<td>30</td>\r\n			<td>30</td>\r\n			<td>20 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Quantitative Aptitude</td>\r\n			<td>35</td>\r\n			<td>35</td>\r\n			<td>20 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning Ability</td>\r\n			<td>35</td>\r\n			<td>35</td>\r\n			<td>20 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>100</td>\r\n			<td>100</td>\r\n			<td>60 minutes</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>IBPS PO MAINS EXAM PATTERN</strong></p>\r\n\r\n<p><strong>IBPS PO Mains Exam consists of two parts i.e. Objective and Descriptive.</strong></p>\r\n\r\n<p>Objective Part consists of 200 marks and Descriptive part consists of 25 marks. Both parts are conducted in online mode.</p>\r\n\r\n<p><strong>OBJECTIVE PART TEST PATTERN</strong></p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Subject Name</strong></td>\r\n			<td><strong>No. of Questions</strong></td>\r\n			<td><strong>Max. Marks</strong></td>\r\n			<td><strong>Time of each section</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Reasoning &amp; Computer Aptitude</td>\r\n			<td>45</td>\r\n			<td>60</td>\r\n			<td>60 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Banking Awareness</td>\r\n			<td>40</td>\r\n			<td>40</td>\r\n			<td>35 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>English Language</td>\r\n			<td>35</td>\r\n			<td>40</td>\r\n			<td>40 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Data Analysis &amp; Interpretation</td>\r\n			<td>35</td>\r\n			<td>60</td>\r\n			<td>45 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Total</td>\r\n			<td>155</td>\r\n			<td>200</td>\r\n			<td>180 minutes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Descriptive Paper</td>\r\n			<td>2</td>\r\n			<td>25</td>\r\n			<td>30 minutes</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>NOTE:</strong>&nbsp;There will be a penalty for wrong answers marked in the Objective Tests. For each question for which a wrong answer has been given by the candidate; one fourth or 0.25 of the marks assigned to that question will be deducted as penalty to arrive at a correct score. If a question is left blank, i.e. no answer is marked by the candidate, there will be no penalty for that question.</p>\r\n\r\n<p><strong>DESCRIPTIVE PART TEST PATTERN</strong></p>\r\n\r\n<p>After a candidate clears Mains Exam IBPS conducts Descriptive Paper where candidates will be judged on their written skills. An Essay writing and a Letter Writing will be given to candidates to write that will constitute of 25 marks and that has to be completed in a time span of 30 minutes.</p>\r\n\r\n<p>The overall time for IBPS Mains Examination constitutes to 180 minutes.</p>\r\n\r\n<p>PENALTY FOR<strong>&nbsp;WRONG ANSWERS</strong></p>\r\n\r\n<p>0.25 marks will be deducted for every question attempted wrong by a candidate in both IBPS PO 2020 Preliminary Exam and IBPS PO 2020 Mains Exam. There will be no deduction of marks for a question left blank/unattempted by a candidate.</p>\r\n\r\n<p><strong>INTERVIEW PROCESS</strong></p>\r\n\r\n<p>The total marks allotted for Interview are 100. The minimum qualifying marks in interview will not be less than 40 % (35 % for SC/ST/OBC/PWD candidates).</p>\r\n\r\n<p><strong>FINAL SELECTION</strong></p>\r\n\r\n<p>The weightage (ratio) of Online Main Exam and interview will be 80:20 respectively. The combined final score of candidates shall be arrived at on the basis of scores obtained by the candidates in the&nbsp;<strong>Mains Examination and Interview.</strong></p>\r\n\r\n<p>A candidate should qualify both in the Online Main Exam and interview and be sufficiently high in the merit to be shortlisted for subsequent provisional allotment process, details of which will be made available subsequently on IBPS website.</p>', '<p><strong>EDUCATIONAL QUALIFICATION</strong></p>\r\n\r\n<p><strong>Graduation Degree:</strong>&nbsp;The eligibility criteria required for the IBPS CWE exam is a graduation degree (BA, BCom, BSc, B.Tech or as such) in any discipline from a University recognized by the Government of India. Any such candidate who has received equivalent qualification which is recognized by the Central Government is also eligible to apply for this exam.</p>\r\n\r\n<p>The candidates must be in possession of a valid Mark-sheet / Degree Certificate that certifies that they are a graduate on the day they register for this exam, and must indicate the percentage of marks obtained in Graduation while registering for the IBPS Bank-PO examination.</p>\r\n\r\n<p><strong>Computer Literacy:</strong>&nbsp;Working knowledge of computer systems is necessary for the job as well as to give the IBPS PO exam which is conducted in online mode.</p>\r\n\r\n<p><strong>Language Proficiency:</strong>&nbsp;Verbal and written proficiency in official language of the State/UT is desirable. The candidate must be able to read, write and speak the language.</p>\r\n\r\n<p><strong>NATIONALITY / CITIZENSHIP OF APPLICANTS</strong></p>\r\n\r\n<p>A candidate applying for IBPS CWE PO Examination must be one of the following:</p>\r\n\r\n<ol>\r\n	<li>Citizen of India.</li>\r\n	<li>Subject of Nepal or Bhutan.</li>\r\n	<li>\r\n	<p>Tibetan Refugee who came to India before 1st January 1962 with the intention of permanent settlement.</p>\r\n	</li>\r\n	<li>\r\n	<p>Person of Indian Origin (PIO) who has migrated from Burma, Pakistan, Sri Lanka, Vietnam or East African countries of Zaire, Kenya, Tanzania, Uganda, Zambia, Ethiopia, Malawi, with the intention of permanent settlement in India.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Candidates belonging to the category 2, 3, 4 must have a certificate of eligibility issued by the Govt of India in their favour.</p>\r\n\r\n<p><strong>AGE LIMIT</strong></p>\r\n\r\n<p>Any candidate who is applying for the IBPS CWE examination should not be less than 20 years old and not more than 30 years old at the time of registration. In addition to this, there is age relaxation applicable to category wise candidates as per the government rules.</p>', '5000', 'IBPS PO: Syllabus, Eligibility, Exam Pattern | Sterling Education', 'This article discusses all the important points regarding IBPS PO exams like eligibility criteria, exam pattern, syllabus, pay scale etc.', 'This article discusses all the important points regarding IBPS PO exams like eligibility criteria, exam pattern, syllabus, pay scale etc.', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-29 15:30:56', '2022-12-12 14:08:12', '2022-12-12 14:08:12'),
