(34, NULL, '', '1235094712.jpg', 'Private One Day Agra Trip visit Historical Monuments', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Being the prime tourist destination in India, Agra is visited by a large number of tourists every day. Agra is situated on the shore of the river Yamuna. One day Agra tour takes you to the major attraction of the Mughals city that includes incredible Taj Mahal, Agra Fort, and Akbar Tombs. To give a little twist to the tour, Indiator provides you an opportunity to experience the ride of a lifetime in Tonga outside the Taj Mahal.</p>\r\n\r\n<p><strong>HIGHLIGHTS</strong></p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Know more about the aristocracy of the Mughals dynasty.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Get transfixed by the beauty of Taj Mahal.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;A testament to the Mughal architectural wonder, visit Agra Fort.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Discover the primitive Mughal Mausoleum Agra Tomb.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Take an exhilarating Tonga ride.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<p>At around 10:00 am, our envoy will pick you up from the lobby of the hotel in Agra for the memorable one day Agra tour. Then our driver will drive you towards the Taj Mahal that was constructed by 20,000 artisans lead by the main architect Ustad Ahmad Lahauri. This monument mesmerizes you with its white beauty. After that, enjoy a Tonga ride outside the monument. Later proceed to explore the Agra Fort that houses many buildings like the Diwan-I-Khas, Diwan-I-Aam, Moti Masjid and few more.</p>\r\n\r\n<p><br />\r\n&nbsp;If you are feeling uneasy due to hunger pangs we will take you to a good local restaurant to satiate your cravings. Once done with a lunch proceed for a glimpse of the magnificent architecture of the Akbar&rsquo;s Tomb and delve into its beauty. This Agra tour also gives you the time to shop for your loved ones.Finally, your fun-filled one day Agra trip comes to an end and we will drop you back to your hotel.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Inclusions</p>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;Sightseeing with English speaking tour guide.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Entry Fee of Taj Mahal, Akbar Tomb &amp; Agra Fort.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;All sightseeing by private air condition Car.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Mineral water<br />\r\n&bull;&nbsp;&nbsp; &nbsp;All taxes and service charges.</p>\r\n\r\n<p>Exclusions</p>\r\n\r\n<ul>\r\n	<li>Air or train fare.</li>\r\n	<li>Camera fee at monuments.</li>\r\n	<li>Expense arising out of unexpected circumstances like natural calamities, flight cancellation or delay.</li>\r\n</ul>', 'Agra', '', '2', '', '1D/1N', '5000', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-29 08:42:35', '2022-10-31 16:18:13', '2022-10-31 16:18:13', '10', '', '', '', ''),
(35, NULL, '', '181905926.jpg', 'Spectacular Krabi and Phuket Getaway', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Gaze at the beautiful sky as you embark on a ferry ride from Ao Nang Krabi to reach Phuket. You will be picked up from your hotel in Ao Nang and transferred to Nopparat Thara Pier (Krabi) by a shared vehicle. Upon reaching Phuket (Rassada Pier), you will be transferred to your hotel in Patong/Kata/Karon area by a shared vehicle. Please note that the ferry timings will be 15:00 hrs to 17:30 hrs.</p>', '<p>Inclusions/Exclusions</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>✔&nbsp;Shared One Way Tranfer</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>✘&nbsp;Island fee, National Park fe</p>\r\n	</li>\r\n</ul>', 'Phuket', '', '1', '', '2d-3N', '3544/-', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 16:22:56', '2022-11-15 14:05:06', '2022-11-15 14:05:06', '30%', '', '', '', 'Featured'),
(36, NULL, '', '1799341262.webp', 'Fishermen\'S Harbour Urban Resort Phuket, SHA Extra Plus - Holidays Selections', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Fishermen&#39;s Harbour Urban Resort is a modern, stylish hotel&nbsp;situated at the southern end of Patong and is surrounded by lush greenery with palm, pool, mountain and sea views. Boasting sleek decor, a choice of eateries and impeccable service, this resort is the perfect spot from where to explore the vibrant beach town of Patong with its extensive entertainment, dining and shopping opportunities.<br />\r\n<br />\r\nThere are a choice of guestroom styles to choose from, namely Deluxe Rooms, Deluxe Family Rooms, Deluxe Plus Room, Family Suites and Honeymoon Pool Suite, all of whi</p>', '<ul>\r\n	<li>Room Size : 431 sq.ft</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Interconnected Room</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Air Conditioning</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Wi-Fi</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Room Service</li>\r\n</ul>\r\n\r\n<ul>\r\n</ul>', 'Thailand', '', '3', '', '1D/1N', '2000', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 16:25:26', '2022-11-15 14:05:10', '2022-11-15 14:05:10', '10%', '', '', '', 'Featured'),
(37, NULL, '', '512934121.jpg', 'Phi Phi Island Tour with Lunch by Big Boat - Standard Class (SIC)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Admire the magnificent bays and coastlines of Phi Phi Island on a day tour. Set sail in a standard class Royal Jet Cruiser as you enjoy the crisp air, clear blue skies, and pristine waters. A bunch of fun activities like swimming and sightseeing, await you on this tour! Your exciting day schedule will be as follows:- 07:30hrs: Get transferred from your hotel in Phuket to Rassada pier by a shared vehicle. 8:30hrs: Depart for Phi Phi Island on the big boat. Enjoy the tasty refreshments served on board. (Please stay on board when the boat makes a short stop at the Tonsai pier.) 11:30hrs</p>', '<ul>\r\n	<li>\r\n	<p>✔&nbsp;Join transfer Phuket hotel to pier and back</p>\r\n	</li>\r\n	<li>\r\n	<p>✔&nbsp;Round trip ferry</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>✘&nbsp;Tips and gratuities</p>\r\n	</li>\r\n	<li>\r\n	<p>✘&nbsp;Personal Expenses</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Read More</p>', 'Phuket', '', '5', '', '2D', '3544/-', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 16:27:11', '2022-11-15 14:05:56', '2022-11-15 14:05:56', '10%', '', '', '', ''),
(38, NULL, '', '1238587983.webp', 'Spectacular Krabi and Phuket Getaway', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Dry and sunny weather with pleasant temperatures in Phuket and Cold and pleasant weather with plenty of sunshine in Bangkok.</p>', '<p><img alt=\"lob icon\" src=\"https://hldak.mmtcdn.com/prod-s3-hld-hpcmsadmin/holidays/images/phonixImages/icon-16-activity@3x.png\" style=\"height:20px; width:20px\" />Private Transfer from Pattaya Hotel to Bangkok Hot</p>', 'Bangkok', '', '2', '', '2d-3N', '3544/-', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 16:30:51', '2022-11-15 14:06:01', '2022-11-15 14:06:01', '10%', '', '', '', ''),
