(1, '', 'zxvxzcv', '1428416807.jpg', '0', 'sdfg', NULL, '127.0.0.1', '', '127.0.0.1', '1', '2022-11-01 15:25:20', '2022-11-01 15:31:55', '2022-11-01 15:31:55'),
(2, '', 'Jyoti Soni', '1339154567.webp', 'Student', 'Mentored, Moulded and became our Guiding Light \r\nGained from the knowledge of experienced faculties and helped us constantly to achieve our goals in a short span of time. Not only this but also motivated us to be a better version of ourselves.', NULL, '127.0.0.1', '', '127.0.0.1', '1', '2022-11-01 15:33:51', '2022-12-12 14:03:25', '2022-12-12 14:03:25'),
(3, '', 'Rahul Soni', '1907471473.webp', 'Faculties', 'Personal Growth became my Asset\r\nNever felt like an employee but as a part of a family who constantly motivated me to grow and work hard to gain maximum from the given opportunity and help my students to prosper from my knowledge.', NULL, '127.0.0.1', '', '127.0.0.1', '1', '2022-11-01 15:34:42', '2022-12-21 15:20:05', '2022-12-21 15:20:05'),
(4, '', 'Meenakshi Soni', '1419389367.webp', 'Director', 'Breakthrough performance over the years \r\nSetting no boundaries and having outgrown immensely as a team and giving equal importance to organizational and personal goals. Been effective as well as efficient and worked for the development of society.', NULL, '127.0.0.1', '', '127.0.0.1', '1', '2022-11-01 15:43:59', '2022-12-21 15:19:56', '2022-12-21 15:19:56'),
(5, '', 'Praveen', '764224566.webp', 'Parents', 'Bright Future under Well Guided Mentorship\r\nThe course helped my child in giving him appropriate practice for preparation for Bank Exams and securing a good rank. The different concepts helped him in developing skills and strategy for his exam.', NULL, '127.0.0.1', '', '127.0.0.1', '1', '2022-11-29 16:01:05', '2022-12-21 15:19:50', '2022-12-21 15:19:50'),
(6, '', 'DEVENDRA SINGH', '467999238.webp', 'Traveler', 'it\'s suitable to study but students have to hardwork to acilhieve their target, Ajit sir and subho sir are really a good teacher in the starting you will be as a student but after some days you learn a lot and you don\'t reliese how did  you do it', NULL, '127.0.0.1', NULL, NULL, NULL, '2022-12-21 15:20:58', '2022-12-21 15:20:58', NULL),
(7, '', 'Rahul Soni', '1829598672.webp', 'student', 'This is the place where you can learn English for ssc cgl exam. And this is the famous class for English . Near gopalpura bypass road. Road connectivity ig very good. Near by this class many pg rooms to stay on reasonable price for students .nice teachers and good staff. All facilities are good.weekly tests are available also', NULL, '127.0.0.1', '', '127.0.0.1', NULL, '2022-12-21 15:21:49', '2022-12-21 15:23:43', NULL),
(8, '', 'AAKASH SAHARAN', '1669802232.webp', 'Traveler', 'Very nice Coaching for English....\r\nBest for Hindi medium students.....\r\nThumbs up to Ajit Kumar Rai Sir....', NULL, '127.0.0.1', NULL, NULL, NULL, '2022-12-21 15:22:17', '2022-12-21 15:22:17', NULL),
(9, '', 'THE #GIRL POWEE', '993068006.webp', 'Traveler', 'Nice coaching centre this coaching centre based only English and yoga. Arijit sir is  the best teacher for English his way of teaching English was amazing it help those students whom are weak in English when I attended demo classes 2 or 3.... I was decided to join this academy sir teaching style was excellent sir was friendly to students.', NULL, '127.0.0.1', NULL, NULL, NULL, '2022-12-21 15:22:41', '2022-12-21 15:22:41', NULL);
