(29, NULL, 'a113f27f5ySY', 'Fifth Graders Give Monologues About a Person Whose Life Has Been ‘Overlooked’', '7600e9370DiM', NULL, '<p>asdf</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-05 03:56:49', '2022-10-05 03:59:18', '2022-10-05 03:59:18'),
(30, NULL, '13564b8b7AaD', 'Real estate is property consisting of land and the buildings on it, along with its', 'a956c571bU1N', '1664942296.jpg', '<p>Deuplex</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-05 03:58:16', '2022-10-31 15:46:16', '2022-10-31 15:46:16'),
(31, NULL, 'f2b49d882Ljr', 'Where does it come from?', 'd007b736aCiv', '1664943718.jpg', '<h2>Where does it come from?</h2>\r\n\r\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of &quot;de Finibus Bonorum et Malorum&quot; (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, &quot;Lorem ipsum dolor sit amet..&quot;, comes from a line in section 1.10.32.</p>\r\n\r\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from &quot;de Finibus Bonorum et Malorum&quot; by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-05 04:21:58', '2022-10-31 15:46:20', '2022-10-31 15:46:20'),
(32, 'abc-rest', 'c70cce7168Bs', '7 Incredible Hidden Gems to Explore in Australia22', 'd007b736aCiv', '1667231322.jpg', '<h2><strong>1. Logan Brae Orchards</strong></h2>\r\n\r\n<p><strong>Location:</strong>&nbsp;Australian Capital Territory, Australia</p>\r\n\r\n<p><strong>Nearest Town:</strong>&nbsp;Blackheath</p>\r\n\r\n<p>Nestled in the quaint&nbsp;<em>Megalong Valley</em>&nbsp;in the city of&nbsp;<em>Blue Mountains</em>, Logan Brae Orchards is a 100-year-old family-owned farm. The estate houses over 6,000 apple trees, and produces the sweetest and freshest selection of juices, pies, apple butter, plum jam, jelly drizzles and fruit baskets.</p>\r\n\r\n<p>Take a stroll amidst the lush greenery, enjoy a picnic in the heart of the Blue Mountains, spot exotic birds and play tag with Lottie &ndash; the friendly pet of the owners, while here.</p>', 'asdf', 'asdf', 'dsfa', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:48:42', '2022-12-21 15:27:53', '2022-12-21 15:27:53'),
(33, NULL, '210d20ab0wnE', 'Cobourg Coastal Camp', '523bb4179FDP', '1667231370.jpg', '<p><strong>Location:</strong>&nbsp;Northern Territory, Australia</p>\r\n\r\n<p><strong>Nearest Town:</strong>&nbsp;Jabiru</p>\r\n\r\n<p>If you&rsquo;re looking for a coastal adventure, head to the Cobourg Coastal Camp! Go glamping in the untouched regions of Australia&rsquo;s&nbsp;<em>Northern Territory</em>&nbsp;and enjoy the wilderness at its best. Discover the joy of fishing in the clear blue waters of the&nbsp;<em>Cobourg Marine Park</em>, explore the offbeat tracks of the nature-based camp and unwind in the safari tents encircled by the savannah bushlands.</p>\r\n\r\n<p>What&rsquo;s more? You&rsquo;ll love waking up to birdsongs and refreshing ocean-views in the safari tents!</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:49:30', '2022-12-21 15:27:44', '2022-12-21 15:27:44'),
(34, NULL, '2afad33a9XtB', '. Vineyards & Wineries', 'a956c571bU1N', '1667231446.jpg', '<p><strong>Location:</strong>&nbsp;Various Locations</p>\r\n\r\n<p>A haven for wine lovers, Australia is home to several vineyards, wineries and cellar doors that take the wine tasting experience up a notch.</p>\r\n\r\n<p>Sign up for a winemaker class at&nbsp;<em>D&rsquo;Arenberg</em>&nbsp;and take home your very own personalised bottle of signature wine, taste farm-fresh wines at&nbsp;<em>Yarra Valley</em>, tour the grapevine fields near&nbsp;<em>Margaret River</em>&nbsp;and gobble on delectable meals at selective wineries. Cheers!</p>\r\n\r\n<h2><strong>5. The Keep</strong></h2>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:50:46', '2022-12-21 15:27:14', '2022-12-21 15:27:14'),
(35, NULL, '019e0da48Pmw', 'Majestic Forts & Palaces in Rajasthan That You Absolutely Cannot Miss!', 'd007b736aCiv', '1667231511.jpg', '<ol>\r\n	<li><strong>Amer Fort, Jaipur</strong></li>\r\n</ol>\r\n\r\n<p>The Amer Palace complex is built of pale yellow and pink sandstone exhibiting huge carved gates, cobbled paths, majestic courtyards and latticed marble windows. While here, visit the Diwan-e-Aam, Diwan-e-Khas, Sheesh Mahal (known for the intricate mirror work), Sila Devi Temple and the Zenana.</p>\r\n\r\n<p>Oh! And the sound &amp; light show, held every evening is a compelling experience that you must sign up for!</p>\r\n\r\n<p>This UNESCO World Heritage Site is located 11 kilometres from Jaipur and is easily approachable by road.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong>Lohagarh Fort, Bharatpur</strong></li>\r\n</ol>\r\n\r\n<p>Lohagarh Fort was built by the Maharaja Suraj Mal, ruler of Bharatpur in the 18th century and is one of the strongest forts of India. Surrounded by deep moats, this looming fort is famous for the many times it withstood attacks by the British forces. Some monuments that make for a delightful visit are Kothi Khas, Mahal Khas, Moti Mahal and the Kishori Mahal.</p>\r\n\r\n<p>The fort is located just about 4 kilometres away from Bharatpur Bird Sanctuary and can be reached by road.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong>City Palace Complex, Udaipur</strong></li>\r\n</ol>\r\n\r\n<p>Located on the banks of Lake Pichola, Udaipur City Palace is the largest palace complex in Rajasthan. Replete with mirror, marble, silver and inlay work, this beautiful edifice is a photographer&rsquo;s delight! The complex is home to many attractions, While a major part of the palace has now been converted into a museum (that is an absolute must-visit) showcasing the life and times of the Mewar royal family, the other portion is home to the royal descendants who manage the complex.&nbsp;</p>\r\n\r\n<p>Since the City Palace entrance is located in the busy streets of Udaipur, an auto rickshaw is the best way to reach there.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:51:51', '2022-12-21 15:27:40', '2022-12-21 15:27:40'),
(36, NULL, '6e97e0589YQL', 'Incredible Hidden Gems to Explore in Australia', '7600e9370DiM', '1667231576.jpg', '<p>If the idea of a holiday in Australia makes you dream of cute koala bears, shimmering beaches and hopping kangaroos, then this is a must-read for you. &lsquo;Coz this country is buzzing with hidden gems that are yet to be charted by travellers!<br />\r\nBe it experiencing the cultural history of the Aborigines or exploring the Great Barrier Reef, there is definitely a lot more that you can enjoy on your holiday here!</p>\r\n\r\n<p>Check out our top recommendations of hidden gems located in Australia below.</p>\r\n\r\n<h2><strong>1. Logan Brae Orchards</strong></h2>\r\n\r\n<p><strong>Location:</strong>&nbsp;Australian Capital Territory, Australia</p>\r\n\r\n<p><strong>Nearest Town:</strong>&nbsp;Blackheath</p>\r\n\r\n<p>Nestled in the quaint&nbsp;<em>Megalong Valley</em>&nbsp;in the city of&nbsp;<em>Blue Mountains</em>, Logan Brae Orchards is a 100-year-old family-owned farm. The estate houses over 6,000 apple trees, and produces the sweetest and freshest selection of juices, pies, apple butter, plum jam, jelly drizzles and fruit baskets.</p>\r\n\r\n<p>Take a stroll amidst the lush greenery, enjoy a picnic in the heart of the Blue Mountains, spot exotic birds and play tag with Lottie &ndash; the friendly pet of the owners, while here.</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:52:56', '2022-12-21 15:27:48', '2022-12-21 15:27:48'),
(37, NULL, 'cf759e4ddF9H', 'Snowstorms are a part of the base camp!', '7600e9370DiM', '1667231670.jpg', '<p>Symbolic of Rajputana courage and valor, the Chittor Fort was the capital of Mewar and is now a UNESCO World Heritage Site. Located atop a hill, this glorious fort is spread across 700 acres and stands testimony to the glorious past of the Mewar dynasty.</p>\r\n\r\n<p>While here, visit the Vijay Stambh, explore the palaces and pay your respects at the famous temples.</p>\r\n\r\n<p>Chittorgarh Fort is a 2-hour journey by road from Udaipur.</p>', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-10-31 15:54:30', '2022-12-21 15:27:35', '2022-12-21 15:27:35'),
(38, NULL, '9a2af3cfcu5H', 'What’s Going On in This Picture? | Nov. 28, 2022', 'd007b736aCiv', '1669341738.jpg', 'A teacher shares how he used a Times obituary series to show students that “history is a kind of kaleidoscope, made up of many people’s stories.”', NULL, NULL, NULL, '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-11-25 02:02:18', '2022-12-21 15:27:09', '2022-12-21 15:27:09'),
