(22, '', 'What is the approach of teaching a subject ?', 'We start every subject from its basics and then slowly proceed to advance level.', '200105734.jpg', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-04 13:43:21', '2022-11-13 05:38:11', NULL),
(23, '', 'Is there any charge for demo classes ?', 'No', '532558803.jpg', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-04 13:44:10', '2022-11-13 05:37:55', NULL),
(24, '', 'Is there any discount in the fees ?', 'Discount of ₹500 is given if the complete course fee is paid in single instalment after 2 days of demo classes.', '1310010261.jpg', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-04 13:44:49', '2022-11-13 05:37:36', NULL),
(25, '', 'What is the validity of fees paid for a respective course which I have enrolled ?', 'The fees paid is valid for 2 batches within a year, which helps a student in revising the complete course.', '1025889884.jpg', '1', '127.0.0.1', '1', '127.0.0.1', NULL, '2022-11-04 13:45:29', '2022-11-13 05:37:15', NULL),
(26, '', 'Transfer & Car rental', '<p>Our regional and international partnerships with car rental companies enables us to offer numerous car rental options at competitive pricing.</p>', '128109245.jpg', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-11-04 13:45:53', '2022-11-12 06:57:52', '2022-11-12 06:57:52'),
(27, '', 'Does the Sterling Education provide demo classes ?', 'Yes we provide demo classes of 2 days.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:36:27', '2022-11-13 05:36:27', NULL),
(28, '', 'What is the criteria of doubts solving ?', 'We solve the doubts of students of batch on daily basis, but still if some students hesitate to ask doubts in class then they can communicate with us to arrange a special doubt class on Sunday.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:38:47', '2022-11-13 05:38:47', NULL),
(29, '', 'Do you provide information regarding Exam Notifications?', 'Yes we regularly provide information regarding upcoming exams, results on our WhatsApp group of every batch.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:39:05', '2022-11-13 05:39:05', NULL),
(30, '', 'Do you provide guidance for Bank interviews ?', 'Yes we provide useful tips which will prepare you for facing a Banking exam interview.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:39:25', '2022-11-13 05:39:25', NULL),
(31, '', 'Do you provide tips for cracking the exams ?', 'Yes we provide a study time table along with many useful tips and tricks which will help you to crack exam with ease.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:39:40', '2022-11-13 05:39:40', NULL),
(32, '', 'Does the coaching is provided for all levels of aexam ?', 'Yes, we believe in delivering quality education and we provide coaching for Pre and Mains for Bank exams and for Tier 1, Tier 2 and Tier 3 for SSC Exams.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:40:01', '2022-11-13 05:40:01', NULL),
(33, '', 'Do you provide weekend batches ?', 'No, we do not provide weekend batches. We have full time batches from Monday to Saturday class schedule.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:40:19', '2022-11-13 05:40:19', NULL),
(34, '', 'Criteria of paying fees ?', 'Fees can be paid via Cash, Cheque or online mode.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:40:31', '2022-11-13 05:40:31', NULL),
(35, '', 'Can I take admission in an ongoing batch or I have to wait for next fresh batch ?', 'It all depends on your time preference and urgency of starting the class. We guarantee in such cases to cover up the left over course either by taking extra classes or in new batch.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:40:48', '2022-11-13 05:40:48', NULL),
(36, '', 'Does the institute provide hostel facility ?', 'We do not have direct tie ups with any hostel, but we will provide you some addresses of good PGs near our coaching.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:41:01', '2022-11-13 05:41:01', NULL),
(37, '', 'Can I choose any particular subject or two instead of choosing complete course ?', 'Yes definitely you can customise the subjects plan as per your need.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:41:14', '2022-11-13 05:41:14', NULL),
(38, '', 'How many hours a single class consists of ?', 'Daily 3 hours of classes are conducted.', '', '1', '127.0.0.1', NULL, NULL, NULL, '2022-11-13 05:41:25', '2022-11-13 05:41:25', NULL),
(39, '', 'Can we attend multiple batches ?', 'Yes of course. As we mentioned we provide 2 batches to each student so if student wants to cover course in less time then he/she can attend multiple batches without any extra charges except course fee.', '', '1', '127.0.0.1', '1', '127.0.0.1', '1', '2022-11-13 05:41:38', '2022-12-12 14:03:35', '2022-12-12 14:03:35');
